import React from 'react';

import logo from '../../../resources/img/logo.svg';
import homePageIcon from '../../../resources/img/icon-nav-home.scg';
import moviesIcon from '../../../resources/img/icon-nav-movies.scg';
import bookmarkedIcon from '../../../resources/img/icon-nav-bookmark.scg';
import tvShowsIcon from '../../../resources/img/icon-nav-tv-series.scg';

function LeftSidebar() {
  return (
    <div className='sidebar'>
      <nav>
        <img src={logo} alt="logo" className="logo" />
        <div className="tabs">
          img
        </div>
      </nav>
    </div>
  )
}

export default LeftSidebar
